import {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();
    this.state = {
      linuxHosts : [
        {
          ip:'143.185.140.148',
          name:'ladh1507',
          id:'123Basd3'
        },
        {
          ip:'143.185.140.149',
          name:'ladh1508',
          id:'123Basd4'
        },
        {
          ip:'143.185.140.150',
          name:'ladh1509',
          id:'123Basd5'
        }
      ]
    }
  }

  render() {
    return (
      <div className="App">
        {
          this.state.linuxHosts.map((linuxHosts) => {
            return (
            <div key={linuxHosts.id}>
              <h1>{linuxHosts.name} - {linuxHosts.ip}</h1>
            </div>
            )})
        }
      </div>
    );

  }
}

export default App;
